import React from "react";
import "./Chat1Icon.css";

const Chat1Icon = () => {
  return (
    <svg
      aria-hidden="true"
      className="icon icon-chat1"
      xmlns="http://www.w3.org/2000/svg"
    >
      <use xlinkHref="#icon-chat1"></use>
    </svg>
  );
};

export default Chat1Icon;
